			#intro .img-place { text-align: center; }

			#demo h2 { font-size: 4rem; color: #333; margin-bottom: 5.5rem; }

			#demo .demo__item { position: relative; text-align: center; max-width: 500px; margin-bottom: 40px; }

			#demo .demo__item figure { position: relative; height: 0; padding-top: 86.48649%; margin-bottom: 35px; -webkit-box-shadow: 0 0px 57px rgba(0, 0, 0, 0.21); box-shadow: 0 0px 57px rgba(0, 0, 0, 0.21); }

			#demo .demo__item figure img { position: absolute; top: 0; left: 0; width: 100%; height: 100%; }

			#demo .demo__item figure .custom-btn { position: absolute; top: 0; left: 0; right: 0; bottom: 0; margin: auto; width: 185px; height: 50px; opacity: 0; }

			#demo .demo__item figure .custom-btn:after { color: #fff; }

			#demo .demo__item > span { display: block; line-height: 1; font-size: 2.3rem; font-family: Rufina,serif; font-weight: 700; color: #333; }

			#demo .demo__item:hover figure a { opacity: 1; }

			#purchase { text-align: center; position: relative; }

			#purchase .pattern { position: absolute; top: 0; left: 0; width: 100%; height: 100%; background-color: #4a5b74; opacity: .8; }

			#purchase h2 { margin-bottom: 60px; color: #fff; }

			#purchase .custom-btn.inverted:after { color: #fff; }
